  $.fn.checkbox = function () {
    $(this).each(function () {
      if ($(this).data("x-checkbox") == undefined) {
        var wrapper = $(this)

        // on render
        var checkbox = wrapper.children(":checkbox")
        var isChecked = checkbox.prop("checked")

        wrapper.toggleClass("checked", isChecked)

        var isDisabled = checkbox.prop("disabled")
        if (isDisabled) {
          wrapper.addClass("disabled")
        }

        var isReadonly = checkbox.prop("readonly")
        if (isReadonly) {
          wrapper.addClass("readonly")
        }

        checkbox.on("change", function () {
          var isDisabled = checkbox.prop("disabled")
          var isReadonly = checkbox.prop("readonly")
          var isChecked = checkbox.is(":checked")

          wrapper.toggleClass("disabled", isDisabled)
          wrapper.toggleClass("readonly", isReadonly)
          wrapper.toggleClass("checked", isChecked)
        })

        // on click
        wrapper.click(function (e) {
          if (checkbox.is(":disabled")) {
            return
          }

          if (checkbox.prop("readonly")) {
            return
          }

          var target = $(e.target)
          var isCheckbox = target.is(":checkbox")

          if (isCheckbox) {
            var isChecked = target.prop("checked")

            target.parent().toggleClass("checked", isChecked)
          } else {
            checkbox = target.children(":checkbox")
            var isChecked = checkbox.prop("checked")

            checkbox.prop("checked", !isChecked).trigger("change")

            target.toggleClass("checked", !isChecked)
          }
        })
      }
    })
  }
