(function($) {
  $.fn.per_page = function() {
    this.each(function() {
      
      $(this).click(function(){
        var location = document.location.href;
        if (location.indexOf('?') == -1) {
          document.location.href = location + '?per_page=' + $(this).attr('rel');
        } else {
          //append or overwrite
          if (location.indexOf('per_page=') == -1) {
            document.location.href = location + '&per_page=' + $(this).attr('rel');
          } else {
            document.location.href = location.replace(/per_page=\d+/, 'per_page=' + $(this).attr('rel'));
          }
        }
      });
    });
  }
  
})(jQuery);

